import React from 'react'
import gameserver from '../apis/gameserver.js'

class LeaderboardView extends React.Component{

    state = { leaderboardName : "Leaderboard1", leaderboardEntries :[] }

    constructor(){
        super()
        const response = gameserver.get('/leaderboard/Test')
        console.log(response)

    }

    render(){
        return(
            <div>
                <h1>Leaderboard : {this.state.leaderboardName}</h1>
                <h1>LeaderboardEntries</h1> :
                <table>
                    <thead>
                        <th>Player</th>
                        <th>Score</th>
                    </thead>
                    <tr>

                    </tr>
                </table>
                    {this.state.leaderboardEntries.map(( leaderboard )=> {
                        return <tr>
                            <td>
                            {leaderboard.playerId}
                            </td>
                            <td>
                            {leaderboard.score}
                            </td>


                            </tr>
                    })}

            </div>
        )
    }
}

export default LeaderboardView;
